dataColl.sampProc:
          A fost folosita metoda selectiei aleatoare dirijata astfel:

1) s-a elaborat un model teoretic ce consta in impartirea populatiei Romaniei in blocuri de 10000 de persoane;

2) pentru a putea opera in practica le-au fost asociate blocurilor de populatie de cate 1000 de persoane sectiile de votare (cu populatie mai mare sau mai mica de 1000 de persoane). Eroarea acestei asocieri a fost foarte mica, permitand inlocuirea modelului blocurilor cu cel al sectiilor de votare. din cele aproximativ 15000 de sectii de votare (numai cu populatie adulta), au fost selectate aleator 200 de sectii de votare, cu un pas de 75. Caracterul aleator a fost dat de faptul ca prima sectie de votare a fost aleasa la intamplare de calculator din primele 75 de sectii. Caracterul dirijat (care a condus la o reprezentare proportionala a zonelor geografice) a fost dat de pasul de 75 cu care s-a operat. Astfel, au rezultat 200 de sectii de votare alese de computer, proportional distribuite in zonele tarii, in toate judetele;

3) Avand localitatile si sectiile de votare ne-am asigurat ca operatorii merg exact acolo unde sunt trimisi si nu-si aleg ei sectia pe care o vor. Identificarea subiectilor in teren s-a facut conform instructiunilor de identificare a gospodariilor din esantion. Operatorul trebuia sa verifice toate gospodariile de rromi din perimetrul sectiei de votare, ca o prima etapa. Am recurs la heteroidentificare intrucat nu trebuia sa scapam din vedere gospodariile de rromi daca voiam sa avem reprezentativitatea informatiilor. In cadrul sectiilor de votare au identificat toate gospodariile de rromi pentru ca apoi sa chestionam maxim 20 in fiecare sectie de votare. Daca erau peste 20 de gospodarii intr-o sectie de votare se chestionau 20, restul fiind doar notate cu numarul de persoane si numarul de copii din fiecare pentru a putea extrapola chestionarele efectuate la numarul total de gospodarii

